EarliestDate_1.query:
q = load "${App.Datasets.CarbonEmissions_tp.FullyQualifiedName}";
q = foreach q generate 'TIMESTAMP_DERIVED' as 'TIMESTAMP_DERIVED', 'TIMESTAMP_DERIVED_Day' as 'TIMESTAMP_DERIVED_Day', 'TIMESTAMP_DERIVED_Month' as 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Year' as 'TIMESTAMP_DERIVED_Year';
q = order q by 'TIMESTAMP_DERIVED' desc;
q = foreach q generate  'TIMESTAMP_DERIVED_Year' + "-" +'TIMESTAMP_DERIVED_Month' + "-" + 'TIMESTAMP_DERIVED_Day' as 'Time';
q = order q by 'Time' asc;
q = limit q 1;

